import * as React from 'react';
import List from '@mui/material/List';
import ListItem from '@mui/material/ListItem';
import ListItemAvatar from '@mui/material/ListItemAvatar';
import ListItemText from '@mui/material/ListItemText';
import Avatar from '@mui/material/Avatar';
import CalendarToday from '@mui/icons-material/CalendarToday';
import Divider from '@mui/material/Divider';
import Typography from '@mui/material/Typography';
import Chip from '@mui/material/Chip';
import { Box } from '@mui/system';
export default function  Availability(props) {
  return (
    <List
      sx={{
        width: '100%',

        bgcolor: 'background.paper',
      }}
    >
        <li>
        <Typography
          sx={{ mt: 0.5, ml: 9 }}
          color="text.secondary"
          display="block"
          variant="caption"
        >
          Availability
        </Typography>
      </li>
      <ListItem>
        <ListItemText primary="Location" secondary={`North-`} />
      </ListItem>
      <Divider component="li" />
      <ListItem>
        <ListItemText primary="Work" secondary="Jan 7, 2014" />
      </ListItem>
      <Divider component="li" variant="inset" />
      <ListItem>
        <ListItemText primary="Northern Month(s) Available" secondary="July 20, 2014" />
        <ListItemText primary="Southern Month(s) Available" secondary="July 20, 2014" />
      </ListItem>
      <Divider/>
      <ListItem>
        <ListItemAvatar>
          <Avatar>
            <CalendarToday />
          </Avatar>
        </ListItemAvatar>
        <Box>
            <ListItemText primary="Season /Month(s)"/>
            <Chip label="1" variant="outlined" />
        </Box>

      </ListItem>
      <Divider/>
      <ListItem>

            <Box>
            <ListItemText primary="Time" secondary="----" />
            <ListItemText primary="Time" secondary="----" />
            </Box>
      </ListItem>
    </List>
  );
}
